import React from 'react';
import './RecValue.css';


class RecValue extends React.Component {
    render() {
        let {concepts} = this.props
        return (
            <div>
                <div>
                <p>Ingredients {concepts.name}</p>
                <p>Pre Value {concepts.value}</p>
                </div>
            </div>
        );
    }
}

export default RecValue;
